import{_ as e,c as t,o as i,a4 as n}from"./chunks/framework.CRhGRqNS.js";const g=JSON.parse('{"title":"ASMI1-19 — Arduino Shield Multi-Interface","description":"","frontmatter":{},"headers":[],"relativePath":"release/asmi1-19.md","filePath":"release/asmi1-19.md"}'),r={name:"release/asmi1-19.md"},a=n(`<h1 id="asmi1-19-—-arduino-shield-multi-interface" tabindex="-1">ASMI1-19 — Arduino Shield Multi-Interface <a class="header-anchor" href="#asmi1-19-—-arduino-shield-multi-interface" aria-label="Permalink to &quot;ASMI1-19 — Arduino Shield Multi-Interface&quot;">​</a></h1><p><strong>Version 1.19</strong> | Révision 29 mai 2024</p><hr><h2 id="_1-introduction" tabindex="-1">1. Introduction <a class="header-anchor" href="#_1-introduction" aria-label="Permalink to &quot;1. Introduction&quot;">​</a></h2><p>Le <strong>ASMI1-19</strong> est un shield (carte d&#39;extension) Arduino conçu pour centraliser la gestion des interfaces de communication et d&#39;alimentation dans le contexte du projet B.R.A.S. Ce module constitue un élément essentiel de l&#39;architecture système, servant de point de convergence entre l&#39;Arduino Mega, l&#39;interface utilisateur (HMI), le système moteur et le périphérique d&#39;impression.</p><p>Ce document s&#39;adresse aux développeurs, techniciens, responsables de projet, intégrateurs, et créateurs de PCB impliqués dans le déploiement et la maintenance du système. Une familiarité préalable avec le projet B.R.A.S. est recommandée pour une compréhension optimale.</p><hr><h2 id="_2-nomenclature-et-designation" tabindex="-1">2. Nomenclature et Désignation <a class="header-anchor" href="#_2-nomenclature-et-designation" aria-label="Permalink to &quot;2. Nomenclature et Désignation&quot;">​</a></h2><p>Le code ASMI1-19 se décline comme suit :</p><table><thead><tr><th>Composant</th><th>Signification</th></tr></thead><tbody><tr><td><strong>AS</strong></td><td>Arduino Shield</td></tr><tr><td><strong>M</strong></td><td>Moteur (Motor)</td></tr><tr><td><strong>I</strong></td><td>Imprimante (Printer)</td></tr><tr><td><strong>1</strong></td><td>Version 1</td></tr><tr><td><strong>-19</strong></td><td>Numéro de révision</td></tr></tbody></table><p><strong>Désignation complète</strong> : ASMI1-19 v1.19</p><hr><h2 id="_3-specifications-techniques" tabindex="-1">3. Spécifications Techniques <a class="header-anchor" href="#_3-specifications-techniques" aria-label="Permalink to &quot;3. Spécifications Techniques&quot;">​</a></h2><h3 id="_3-1-caracteristiques-physiques" tabindex="-1">3.1 Caractéristiques Physiques <a class="header-anchor" href="#_3-1-caracteristiques-physiques" aria-label="Permalink to &quot;3.1 Caractéristiques Physiques&quot;">​</a></h3><ul><li><strong>Compatibilité</strong> : Arduino Mega 2560 (dimensions 53 × 101 mm)</li><li><strong>Compatibilité théorique</strong> : Elegoo Mega (non testée)</li><li><strong>Facteur de forme</strong> : Shield 1:1 (empreinte identique à l&#39;Arduino)</li><li><strong>Positionnement</strong> : À installer <strong>obligatoirement au-dessus</strong> de l&#39;Arduino Mega</li><li><strong>Compatibilité avec d&#39;autres shields</strong> : Oui, à condition que le shield DRI0023 soit installé directement au-dessus (configuration testée et validée)</li></ul><h3 id="_3-2-alimentation" tabindex="-1">3.2 Alimentation <a class="header-anchor" href="#_3-2-alimentation" aria-label="Permalink to &quot;3.2 Alimentation&quot;">​</a></h3><ul><li><strong>Alimentation d&#39;entrée</strong> : 12V CC (fournie par le connecteur HMI)</li><li><strong>Distribution</strong> : <ul><li>VIN Arduino : 12V (direct depuis l&#39;alimentation HMI)</li><li>Section moteur : 5V (générée par l&#39;Arduino)</li><li>Imprimante : 9V (convertie via régulateur intégré)</li><li>HMI : 12V (direct)</li></ul></li></ul><p><strong>Rôle du régulateur</strong> : Le shield intègre un convertisseur 12V → 9V équipé de deux condensateurs de stabilisation (en amont et en aval de la conversion) assurant une alimentation stable du périphérique d&#39;impression.</p><h3 id="_3-3-interfaces-de-communication" tabindex="-1">3.3 Interfaces de Communication <a class="header-anchor" href="#_3-3-interfaces-de-communication" aria-label="Permalink to &quot;3.3 Interfaces de Communication&quot;">​</a></h3><table><thead><tr><th>Interface</th><th>Débit</th><th>Protocole</th><th>Connecteur</th></tr></thead><tbody><tr><td>HMI</td><td>9600 baud</td><td>UART/RS-232 (5V)</td><td>Embase 4 broches (J1)</td></tr><tr><td>Imprimante</td><td>19200 baud</td><td>UART/TTL (5V)</td><td>Embase 4 broches (J2)</td></tr><tr><td>Section moteur</td><td>5V logique</td><td>Signaux numériques</td><td>Embase 8 broches (J3)</td></tr></tbody></table><hr><h2 id="_4-architecture-et-connectique" tabindex="-1">4. Architecture et Connectique <a class="header-anchor" href="#_4-architecture-et-connectique" aria-label="Permalink to &quot;4. Architecture et Connectique&quot;">​</a></h2><h3 id="_4-1-connecteur-j1-—-interface-hmi-embase-4-broches" tabindex="-1">4.1 Connecteur J1 — Interface HMI (Embase 4 broches) <a class="header-anchor" href="#_4-1-connecteur-j1-—-interface-hmi-embase-4-broches" aria-label="Permalink to &quot;4.1 Connecteur J1 — Interface HMI (Embase 4 broches)&quot;">​</a></h3><p>Le connecteur J1 assure la liaison bidirectionnelle avec l&#39;interface utilisateur (HMI).</p><table><thead><tr><th>Broche</th><th>Signal</th><th>Description</th></tr></thead><tbody><tr><td>1</td><td>+12V</td><td>Alimentation directe depuis le connecteur HMI</td></tr><tr><td>2</td><td>GND</td><td>Masse commune</td></tr><tr><td>3-4</td><td>Transmission</td><td>Données UART (TX/RX) en protocole RS-232 5V</td></tr></tbody></table><p><strong>Remarque importante</strong> : L&#39;alimentation 12V entrante transite par ce connecteur. Des mesures prélevées directement au niveau du connecteur J1 refléteront la tension brute (12V). Après conversion interne TTL, les signaux de communication passent à 5V.</p><h3 id="_4-2-connecteur-j2-—-interface-imprimante-embase-4-broches" tabindex="-1">4.2 Connecteur J2 — Interface Imprimante (Embase 4 broches) <a class="header-anchor" href="#_4-2-connecteur-j2-—-interface-imprimante-embase-4-broches" aria-label="Permalink to &quot;4.2 Connecteur J2 — Interface Imprimante (Embase 4 broches)&quot;">​</a></h3><p>Le connecteur J2 gère la communication et l&#39;alimentation du périphérique d&#39;impression.</p><table><thead><tr><th>Broche</th><th>Signal</th><th>Description</th></tr></thead><tbody><tr><td>1</td><td>+9V</td><td>Alimentation régulée (convertie depuis 12V)</td></tr><tr><td>2</td><td>GND</td><td>Masse commune</td></tr><tr><td>3-4</td><td>Transmission</td><td>Données UART (TX/RX) en protocole TTL 5V</td></tr></tbody></table><p><strong>Débit configurable</strong> : 19200 baud par défaut.</p><h3 id="_4-3-connecteur-j3-—-section-moteur-embase-8-broches" tabindex="-1">4.3 Connecteur J3 — Section Moteur (Embase 8 broches) <a class="header-anchor" href="#_4-3-connecteur-j3-—-section-moteur-embase-8-broches" aria-label="Permalink to &quot;4.3 Connecteur J3 — Section Moteur (Embase 8 broches)&quot;">​</a></h3><p>Le connecteur J3 délivre l&#39;alimentation et les signaux de contrôle vers la section moteur (casier).</p><table><thead><tr><th>Broche</th><th>Signal</th><th>Description</th></tr></thead><tbody><tr><td>1</td><td>+12V</td><td>Alimentation moteur (broche de référence)</td></tr><tr><td>2</td><td>GND</td><td>Masse commune</td></tr><tr><td>3-4</td><td>+5V</td><td>Alimentation logique pour commandes boutons</td></tr><tr><td>5-6</td><td>+5V</td><td>Alimentation LED (résistances 220Ω intégrées)</td></tr><tr><td>7-8</td><td>Non utilisées</td><td>Réservées pour extension future</td></tr></tbody></table><p><strong>Remarque</strong> : Les broches 3-4 sont destinées à recevoir les signaux de commande des boutons. Les broches 5-6 possèdent des résistances de limitation de courant (220Ω) intégrées au PCB pour la commande sécurisée des LED.</p><hr><h2 id="_5-representations-visuelles" tabindex="-1">5. Représentations Visuelles <a class="header-anchor" href="#_5-representations-visuelles" aria-label="Permalink to &quot;5. Représentations Visuelles&quot;">​</a></h2><h3 id="_5-1-vue-pcb-schematique" tabindex="-1">5.1 Vue PCB Schématique <a class="header-anchor" href="#_5-1-vue-pcb-schematique" aria-label="Permalink to &quot;5.1 Vue PCB Schématique&quot;">​</a></h3><p><img src="https://raw.githubusercontent.com/kerogs/bras/refs/heads/main/assets/preview1.png" alt="Vue PCB Schématique"></p><p><em>Figure 1 : Disposition générale et connecteurs du shield ASMI1-19</em></p><h3 id="_5-2-schema-electrique-detaille" tabindex="-1">5.2 Schéma Électrique Détaillé <a class="header-anchor" href="#_5-2-schema-electrique-detaille" aria-label="Permalink to &quot;5.2 Schéma Électrique Détaillé&quot;">​</a></h3><p><img src="https://raw.githubusercontent.com/kerogs/bras/refs/heads/main/assets/preview2.png" alt="Schéma Électrique"></p><p><em>Figure 2 : Schéma fonctionnel montrant les chemins de conversion et distribution de l&#39;alimentation</em></p><h3 id="_5-3-vue-reelle-du-pcb" tabindex="-1">5.3 Vue Réelle du PCB <a class="header-anchor" href="#_5-3-vue-reelle-du-pcb" aria-label="Permalink to &quot;5.3 Vue Réelle du PCB&quot;">​</a></h3><h4 id="face-superieure" tabindex="-1">Face Supérieure <a class="header-anchor" href="#face-superieure" aria-label="Permalink to &quot;Face Supérieure&quot;">​</a></h4><p><img src="https://raw.githubusercontent.com/kerogs/bras/refs/heads/main/assets/1-asmi1-19.jpg" alt="Vue Dessus du PCB"></p><p><em>Figure 3 : Vue de dessus du shield ASMI1-19 montrant les connecteurs et composants principaux</em></p><h4 id="face-inferieure" tabindex="-1">Face Inférieure <a class="header-anchor" href="#face-inferieure" aria-label="Permalink to &quot;Face Inférieure&quot;">​</a></h4><p><img src="https://raw.githubusercontent.com/kerogs/bras/refs/heads/main/assets/2-asmi1-19.jpg" alt="Vue Dessous du PCB"></p><p><em>Figure 4 : Vue de dessous du shield montrant les connexions internes et les composants de stabilisation</em></p><h3 id="_5-4-images-de-fabrication" tabindex="-1">5.4 Images de Fabrication <a class="header-anchor" href="#_5-4-images-de-fabrication" aria-label="Permalink to &quot;5.4 Images de Fabrication&quot;">​</a></h3><p><img src="https://raw.githubusercontent.com/kerogs/bras/refs/heads/main/assets/fab1-asmi1-19.jpg" alt="Fabrication Vue 1"></p><p><em>Figure 5 : Étape de fabrication du shield ASMI1-19 (1/2)</em></p><p><img src="https://raw.githubusercontent.com/kerogs/bras/refs/heads/main/assets/fab2-asmi1-19.jpg" alt="Fabrication Vue 2"></p><p><em>Figure 6 : Étape de fabrication du shield ASMI1-19 (2/2)</em></p><hr><h2 id="_6-principes-de-fonctionnement" tabindex="-1">6. Principes de Fonctionnement <a class="header-anchor" href="#_6-principes-de-fonctionnement" aria-label="Permalink to &quot;6. Principes de Fonctionnement&quot;">​</a></h2><h3 id="_6-1-architecture-globale" tabindex="-1">6.1 Architecture Globale <a class="header-anchor" href="#_6-1-architecture-globale" aria-label="Permalink to &quot;6.1 Architecture Globale&quot;">​</a></h3><p>Le shield ASMI1-19 fonctionne selon le modèle suivant :</p><ol><li><strong>Entrée d&#39;alimentation</strong> : 12V provenant du HMI via le connecteur J1</li><li><strong>Routage vers Arduino</strong> : La tension 12V est acheminée vers la broche VIN de l&#39;Arduino Mega, permettant au régulateur interne de l&#39;Arduino de générer les 5V nécessaires</li><li><strong>Conversion secondaire</strong> : Un régulateur interne convertit 12V en 9V pour l&#39;imprimante (avec stabilisation par condensateurs)</li><li><strong>Distribution des signaux</strong> : Les données UART (9600 baud HMI / 19200 baud imprimante) sont gérées nativement par les ports série de l&#39;Arduino</li></ol><h3 id="_6-2-flux-de-donnees" tabindex="-1">6.2 Flux de Données <a class="header-anchor" href="#_6-2-flux-de-donnees" aria-label="Permalink to &quot;6.2 Flux de Données&quot;">​</a></h3><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span>HMI (12V) ──&gt; J1 ──&gt; VIN Arduino ──&gt; Arduino génère 5V</span></span>
<span class="line"><span>                                    ├──&gt; J3 Section moteur</span></span>
<span class="line"><span>                                    └──&gt; UART HMI/Imprimante</span></span>
<span class="line"><span></span></span>
<span class="line"><span>Imprimante ──&gt; J2 ──&gt; Convertisseur 12V→9V ──&gt; Alimentation</span></span>
<span class="line"><span>           ──&gt; UART RX/TX (5V) via Arduino</span></span></code></pre></div><hr><h2 id="_7-instructions-d-installation" tabindex="-1">7. Instructions d&#39;Installation <a class="header-anchor" href="#_7-instructions-d-installation" aria-label="Permalink to &quot;7. Instructions d&#39;Installation&quot;">​</a></h2><h3 id="_7-1-prealables" tabindex="-1">7.1 Préalables <a class="header-anchor" href="#_7-1-prealables" aria-label="Permalink to &quot;7.1 Préalables&quot;">​</a></h3><ul><li>Arduino Mega 2560 ou Elegoo Mega (non testé)</li><li>Alimentation 12V stable (fournie par le système HMI)</li><li>Shield DRI0023 (si installation prévue au-dessus du ASMI1-19)</li></ul><h3 id="_6-2-procedure-d-installation" tabindex="-1">6.2 Procédure d&#39;Installation <a class="header-anchor" href="#_6-2-procedure-d-installation" aria-label="Permalink to &quot;6.2 Procédure d&#39;Installation&quot;">​</a></h3><ol><li><strong>Préparation</strong> : Éteindre complètement le système et débrancher l&#39;alimentation</li><li><strong>Positionnement</strong> : Placer le shield ASMI1-19 <strong>directement et uniquement au-dessus</strong> de l&#39;Arduino Mega <ul><li>Les connecteurs de l&#39;Arduino Mega doivent être parfaitement alignés avec les empreintes du shield</li><li>Appuyer fermement jusqu&#39;à obtenir un contact optimal</li></ul></li><li><strong>Installation du shield secondaire</strong> : Si le shield DRI0023 doit être utilisé, l&#39;installer directement au-dessus du ASMI1-19</li><li><strong>Connexions externes</strong> : <ul><li>Brancher le connecteur HMI sur J1 (alimentation 12V et données)</li><li>Brancher le connecteur d&#39;imprimante sur J2</li><li>Brancher le connecteur moteur sur J3</li></ul></li><li><strong>Vérification</strong> : Contrôler visuellement que tous les connecteurs sont bien enfichés</li><li><strong>Mise sous tension</strong> : Activer l&#39;alimentation et vérifier les voyants (le cas échéant)</li></ol><h3 id="_6-3-restrictions-critiques" tabindex="-1">6.3 Restrictions Critiques <a class="header-anchor" href="#_6-3-restrictions-critiques" aria-label="Permalink to &quot;6.3 Restrictions Critiques&quot;">​</a></h3><p>⚠️ <strong>INTERDIT</strong> : Installer d&#39;autres shields en dessous du ASMI1-19. Le shield délivre directement 12V sur les broches d&#39;alimentation et tout équipement mal adapté risquerait une destruction.</p><p>⚠️ <strong>FORTEMENT DÉCONSEILLÉ</strong> : Installer d&#39;autres shields au-dessus du ASMI1-19, à l&#39;exception du DRI0023 qui a été spécifiquement testé et validé dans cette configuration.</p><hr><h2 id="_7-guide-de-mesure-et-diagnostic" tabindex="-1">7. Guide de Mesure et Diagnostic <a class="header-anchor" href="#_7-guide-de-mesure-et-diagnostic" aria-label="Permalink to &quot;7. Guide de Mesure et Diagnostic&quot;">​</a></h2><h3 id="_7-1-points-de-mesure" tabindex="-1">7.1 Points de Mesure <a class="header-anchor" href="#_7-1-points-de-mesure" aria-label="Permalink to &quot;7.1 Points de Mesure&quot;">​</a></h3><p>Lors du diagnostic ou de la prise de mesures, respecter l&#39;ordre de priorité suivant :</p><table><thead><tr><th>Point</th><th>Tension attendue</th><th>Localisation</th><th>Remarques</th></tr></thead><tbody><tr><td>Entrée HMI (J1:1)</td><td>12V ± 0.5V</td><td>Connecteur J1, broche 1</td><td>Mesure directe du bus HMI</td></tr><tr><td>VIN Arduino</td><td>12V ± 0.5V</td><td>Sortie du shield vers Arduino</td><td>Après conversion interne de l&#39;Arduino</td></tr><tr><td>Sortie UART (J1:3-4)</td><td>5V TTL</td><td>Connecteur J1, broches 3-4</td><td>Après conversion TTL par Arduino</td></tr><tr><td>Alimentation imprimante (J2:1)</td><td>9V ± 0.3V</td><td>Connecteur J2, broche 1</td><td>Après régulateur 12V→9V</td></tr><tr><td>Sortie UART imprimante (J2:3-4)</td><td>5V TTL</td><td>Connecteur J2, broches 3-4</td><td>Signal logique 5V</td></tr></tbody></table><h3 id="_7-2-avertissement-critique" tabindex="-1">7.2 Avertissement Critique <a class="header-anchor" href="#_7-2-avertissement-critique" aria-label="Permalink to &quot;7.2 Avertissement Critique&quot;">​</a></h3><p><strong>Important</strong> : Les mesures effectuées sur les signaux UART <strong>avant</strong> conversion en protocole TTL (c&#39;est-à-dire du côté HMI, avant passage par la chaîne de traitement Arduino) doivent impérativement être réalisées au point de mesure côté HMI.</p><p><strong>Raison</strong> : Après conversion TTL interne, tous les signaux logiques passent à 5V. Un mauvais positionnement de la sonde peut conduire à :</p><ul><li>Une lecture incorrecte (faux contact en zone de conversion)</li><li>Une perturbation du signal TTL</li><li>Une détérioration prématurée des composants de conversion</li></ul><p><strong>Recommandation</strong> : Toujours mesurer les tensions avant la conversion TTL pour éviter les artefacts de mesure.</p><hr><h2 id="_8-considerations-electriques" tabindex="-1">8. Considérations Électriques <a class="header-anchor" href="#_8-considerations-electriques" aria-label="Permalink to &quot;8. Considérations Électriques&quot;">​</a></h2><h3 id="_8-1-protections-integrees" tabindex="-1">8.1 Protections Intégrées <a class="header-anchor" href="#_8-1-protections-integrees" aria-label="Permalink to &quot;8.1 Protections Intégrées&quot;">​</a></h3><p>Le shield ASMI1-19 <strong>n&#39;est pas équipé</strong> de protections contre les surcharges ou les court-circuits externes. La robustesse du système repose sur :</p><ul><li><strong>Stabilisation de l&#39;alimentation</strong> : Deux condensateurs de découplage (avant et après le régulateur 12V→9V)</li><li><strong>Respect des débits de communication</strong> : Les vitesses UART (9600 et 19200 baud) ont été sélectionnées pour minimiser les interférences</li><li><strong>Conception des connecteurs</strong> : Empreintes standardisées (embase 4 et 8 broches) réduisant les erreurs de connexion</li></ul><h3 id="_8-2-charge-maximale-recommandee" tabindex="-1">8.2 Charge Maximale Recommandée <a class="header-anchor" href="#_8-2-charge-maximale-recommandee" aria-label="Permalink to &quot;8.2 Charge Maximale Recommandée&quot;">​</a></h3><p>Bien que non officiellement spécifiée, le système doit être dimensionné en considérant :</p><ul><li><strong>Imprimante</strong> : Consommation typique ≤ 500 mA @ 9V</li><li><strong>Section moteur</strong> : Consommation définie par les spécifications du projet B.R.A.S.</li><li><strong>HMI</strong> : Alimentation fournie par source externe (faible impact sur le régulateur Arduino)</li></ul><p>Une consommation excessive risquerait de surcharger le régulateur interne de l&#39;Arduino (5V).</p><hr><h2 id="_9-compatibilite-et-evolution" tabindex="-1">9. Compatibilité et Évolution <a class="header-anchor" href="#_9-compatibilite-et-evolution" aria-label="Permalink to &quot;9. Compatibilité et Évolution&quot;">​</a></h2><h3 id="_9-1-shields-valides" tabindex="-1">9.1 Shields Validés <a class="header-anchor" href="#_9-1-shields-valides" aria-label="Permalink to &quot;9.1 Shields Validés&quot;">​</a></h3><ul><li><strong>DRI0023</strong> : Testé et validé en configuration empilée au-dessus du ASMI1-19</li></ul><h3 id="_9-2-shields-non-testes" tabindex="-1">9.2 Shields Non Testés <a class="header-anchor" href="#_9-2-shields-non-testes" aria-label="Permalink to &quot;9.2 Shields Non Testés&quot;">​</a></h3><ul><li>Elegoo Mega : Compatibilité théorique, non validée expérimentalement</li></ul><h3 id="_9-3-connecteurs-reserves" tabindex="-1">9.3 Connecteurs Réservés <a class="header-anchor" href="#_9-3-connecteurs-reserves" aria-label="Permalink to &quot;9.3 Connecteurs Réservés&quot;">​</a></h3><p>Les broches 7-8 du connecteur J3 sont réservées pour les extensions futures. Aucune fonction n&#39;y est actuellement assignée.</p><hr><h2 id="_10-support-et-maintenance" tabindex="-1">10. Support et Maintenance <a class="header-anchor" href="#_10-support-et-maintenance" aria-label="Permalink to &quot;10. Support et Maintenance&quot;">​</a></h2><h3 id="_10-1-verifications-preventives" tabindex="-1">10.1 Vérifications Préventives <a class="header-anchor" href="#_10-1-verifications-preventives" aria-label="Permalink to &quot;10.1 Vérifications Préventives&quot;">​</a></h3><ul><li><strong>Mensuel</strong> : Vérifier l&#39;intégrité des connecteurs et l&#39;absence de corrosion</li><li><strong>Après installation</strong> : Tester les débits UART avec un oscilloscope ou analyseur logique</li><li><strong>En cas de dysfonctionnement</strong> : Consulter le guide de mesure (section 7)</li></ul><h3 id="_10-2-remplacement-de-composants" tabindex="-1">10.2 Remplacement de Composants <a class="header-anchor" href="#_10-2-remplacement-de-composants" aria-label="Permalink to &quot;10.2 Remplacement de Composants&quot;">​</a></h3><p>En cas de défaillance du régulateur 12V→9V ou des condensateurs de stabilisation, le shield devra être remplacé en entier. Aucune réparation composant n&#39;est recommandée.</p><hr><h2 id="_12-historique-des-revisions" tabindex="-1">12. Historique des Révisions <a class="header-anchor" href="#_12-historique-des-revisions" aria-label="Permalink to &quot;12. Historique des Révisions&quot;">​</a></h2><table><thead><tr><th>Version</th><th>Révision</th><th>Date</th><th>Modifications</th></tr></thead><tbody><tr><td>1</td><td>19</td><td>29 mai 2024</td><td>Version initiale documentée</td></tr></tbody></table><hr><p><strong>Projet B.R.A.S.</strong><br><em>Dernière mise à jour : 29 mai 2024</em></p>`,108),s=[a];function o(l,d,u,c,h,m){return i(),t("div",null,s)}const b=e(r,[["render",o]]);export{g as __pageData,b as default};
